  return (
    <>
      <Navbar />
      <section className="banner">
      <div className="banner_write">
        <h4>Trade-in-offer</h4>
        <h2>Super value deals</h2>
        <h1>On all products</h1>
        <p>Save moore with coupons & up to 70% off!</p>
        <button>Shop Now</button>
        </div>
      </section>
      <section>
      <div>
      <img src="https://img.freepik.com/free-vector/fast-delivery-truck-with-motion-lines-online-delivery-express-delivery-quick-move-fast-shipping-truck-apps-websites-cargo-van-moving-fast-chronometer-fast-distribution-service-24-7_435184-654.jpg" alt='error' />
      </div>
      </section>
    </>
  );
}

export default Home;
